;; gorilla-repl.fileformat = 1

;; **
;;; # 3CNFSAT
;;; 
;;; In probabilistic programming systems like Anglican one may easily write programs that intentionally or unintentionally result in inference problems that are arbitrarily hard.  
;;; 
;;; From Wikipedia "Like the satisfiability problem for arbitrary formulas, determining the satisfiability of a formula in conjunctive normal form where each clause is limited to at most three literals is NP-complete also..."
;;; 
;;; A programmer can easily write a program which corresponds to 3CNFSAT solving.  In fact we can pose SAT solving as inference as we do below.
;;; 
;;; Note that this suggests that general purpose inference in probabilistic programming systems is hard.  
;; **

;; @@
(ns satisfiability
  (:require [gorilla-plot.core :as plot])
  (:use clojure.repl
        [mrepl core]
        [embang runtime emit]
        [clojure.string :only (join split blank?)]))

(defn uncps
  "reconstructs value-returning function from CPS form"
  [f]
  (fn [& args]
    (trampoline (apply f (fn [v _] v) nil args))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;satisfiability/uncps</span>","value":"#'satisfiability/uncps"}
;; <=

;; **
;;; Again we'll make use of the Dirac distribution to impose the hard constraint that a conjunction is satisfied exactly.
;; **

;; @@
(defdist dirac
  "Dirac distribution"
  [x] []
      (sample [this] x)
      (observe [this value] (if (= x value) 0.0 (- (/ 1.0 0.0)))))

(defm satisfiable-conjunction [state] 
  (let [v (fn [i] (nth state i))]
       (and ;(or (v 0) (v 1) (v 2)) 
            (or (v 0) (v 1) (not (v 2)))
            (or (v 0) (not (v 1)) (v 2)) 
            (or (v 0) (not (v 1)) (not (v 2)))
            (or (not (v 0)) (v 1) (v 2)) 
            (or (not (v 0)) (v 1) (not (v 2)))
            (or (not (v 0)) (not (v 1)) (v 2)) 
            (or (not (v 0)) (not (v 1)) (not (v 2))))))

(defm unsatisfiable-conjunction [state] 
  (let [v (fn [i] (nth state i))]
       (and (or (v 0) (v 1) (v 2)) 
            (or (v 0) (v 1) (not (v 2)))
            (or (v 0) (not (v 1)) (v 2)) 
            (or (v 0) (not (v 1)) (not (v 2)))
            (or (not (v 0)) (v 1) (v 2)) 
            (or (not (v 0)) (v 1) (not (v 2)))
            (or (not (v 0)) (not (v 1)) (v 2)) 
            (or (not (v 0)) (not (v 1)) (not (v 2))))))

(def N 3)

(with-primitive-procedures [dirac] 
  (defquery Three-CNF-SAT [N conjunction] 
    "explores an N-dimensional universe for worlds that 
    satisfy the conjunction cpsfn with domain (list bools) and range bool"
    (let [state (repeatedly N (fn [] (sample (flip 0.5))))]
    (observe (dirac true) (conjunction state))
   (predict :state state))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;satisfiability/Three-CNF-SAT</span>","value":"#'satisfiability/Three-CNF-SAT"}
;; <=

;; **
;;; We can run the query seeking satisfying worlds.  
;; **

;; @@
(->> (doquery :pcascade Three-CNF-SAT [3 satisfiable-conjunction] :debug true :number-of-particles 100)
     (take 1000)
     (filter #(not (= Double/NEGATIVE_INFINITY (:embang.state/log-weight %))))
     (map get-predicts)
     (map :state)
     (map (uncps satisfiable-conjunction))
     ;(first)
     )
